import React, { useState, useEffect } from 'react';
import { ListItem, Typography, Box } from "@mui/material";
import api from "../../api";
import ClearIcon from '@mui/icons-material/Clear';
export default function Notify() {
    const [notifyData, setNotifyData] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await api.get('/get/requests');
                setNotifyData(response.data.success);
            } catch (error) {
                console.error("Error fetching data:", error);
            }
        };
        fetchData();
    }, []); 


    const handleDeleteNotify = () => {

    };

    return (
        <Box>
            {notifyData.map((item) => (
                <Box key={item.id}>
                    <ListItem alignItems="flex-start">
                        <Typography>Successfuly request sent at:{item.created_at}. Status:{item.status}
                      
                        </Typography>
                        <ClearIcon 
                          
                          sx={{ position: 'absolute', top: 5, right: 5, cursor: 'pointer' }} 
                          onClick={() => handleDeleteNotify(item.id)} 
                      />
                    </ListItem>
                  
                </Box>
            ))}
        </Box>
    )
}
